import React from 'react';
import './App.css';
import TextField from '@material-ui/core/TextField';

function App() {
  return (
    <div className="App">
        <p>SPONTANEOUSLY</p>
        <form noValidate autoComplete="off">
          <TextField id="standard-basic" label="Insert Text" />
          <TextField id="time" label="Alarm clock"
        type="time"
        defaultValue="07:30"
        className={classes.textField}
        InputLabelProps={{
          shrink: true,
        }}
        inputProps={{
          step: 300, // 5 min
        }}
      />
        </form>
    </div>
  );
}

export default App;
